import React from 'react';

function NavBar(){

    return (
        <div id="nav-bar-container">
            <div>
                <div className="nav-bar-button">
                    <p>Home</p>
                </div>
                <div className="nav-bar-button">
                    <p>Work</p>
                </div>
                <div className="nav-bar-button">
                    <p>Projects</p>
                </div>
                <div className="nav-bar-button">
                    <p>Contact</p>
                </div>
            </div>
        </div>
    );
}

export default NavBar;
